import 'bootstrap/dist/css/bootstrap.min.css';

function Buttonx() {
  return (
    <>
    <div><Button variant="dark" size="lg">Admin</Button>{''}</div>
      
     <div> <Button variant="dark" size="lg">Doctor</Button>{''}</div>

    <div><Button variant="dark" size='lg'>Patient</Button>{''}</div>
    </>
  );
}

export default Buttonx;
